Quick-Add Compute Dialog
Allows rapid addition of CPU and GPU data to a listing.
Currently supports direct ID input for both CPU and GPU.
Future enhancement: searchable dropdown for component selection.
@example
```tsx
<QuickAddComputeDialog
listingId={123}
open={isOpen}
onOpenChange={setIsOpen}
/>
```

Quick-Add Connectivity Dialog
Allows rapid addition of ports profile data to a listing.
Currently supports ports_profile_id input.
Future enhancement: port builder UI for creating custom port profiles.
@example
```tsx
<QuickAddConnectivityDialog
listingId={123}
open={isOpen}
onOpenChange={setIsOpen}
/>
```

Quick-Add Memory Dialog
Allows rapid addition of RAM specifications to a listing.
Supports capacity, type, and speed configuration.
@example
```tsx
<QuickAddMemoryDialog
listingId={123}
open={isOpen}
onOpenChange={setIsOpen}
/>
```

Quick-Add Storage Dialog
Allows rapid addition of storage specifications to a listing.
Supports both primary and secondary storage configurations.
@example
```tsx
<QuickAddStorageDialog
listingId={123}
open={isOpen}
onOpenChange={setIsOpen}
/>
```

